SUM.en:
SUM 
 Description: summarize and calculate the indicators; 
 Usage: Sum(evaluate fields/expressions); 
 Example: Sum(Net Sales), which returns the total calculated value of Net Sales;

AVG.en:
AVG 
 Description: calculate the average value of the index; 
 Usage: Avg(evaluate field/expression); 
 Example: Avg(Net Sales), which returns the average calculated value of Net Sales;

MAX.en:
MAX 
 Description: Read the maximum value of the index calculation; 
 Usage: Max(evaluate fields/expressions); 
 Example: Max(Net Sales), which returns the maximum value of Net Sales;

MIN.en:
MIN 
 Description: Read the minimum value of the index calculation; 
 Usage: Min(evaluate fields/expressions); 
 Example: Min(Net Sales), which returns the minimum value of Net Sales;

COUNT.en:
COUNT 
 Description: the index of the count calculation; 
 Usage: Count(evaluate fields/expressions); 
 Example: Count(Net Sales), which returns the Count value of Net Sales;

MEDIAN.en:
MEDIAN 
 Description: Read the median value of the index calculation; 
 Usage: MEDIAN(evaluate field/expression); 
 Example: MEDIAN(Net Sales), which returns the median value of Net Sales;

DAY.en:
DAY 
 Description: return the calculated index value on the day of the selected date, the default is summary; 
 Usage: DAY(evaluate field/expression, n); 
 Example: DAY(MAX(Net Sales),-3), returns the maximum value of Net Sales on the DAY before the selected date, where MAX,-3 is not required;

Past_7_days.en:
DAY 
 Description: Returns the data of the past 7 days (excluding that day) of the selected date, which is summarized by default; 
 Usage: Past_7_days(evaluate fields/expressions); 
 Example: Past_7_days(MAX(Net Sales)), returns the maximum value of Net Sales for the past 7 days(not including the day) of the selected date;

Last_30_days.en:
DAY 
 Description: Returns the data of the past 30 days (excluding that day) of the selected date, which is summarized by default; 
 Usage: Last_30_days(evaluates fields/expressions); 
 Example: Last_30_days(MAX(Net Sales)), which returns the maximum value of Net Sales for the past 30 days(not including that day) of the selected date;

Last_90_days.en:
DAY 
 Description: Returns the data of the past 90 days (excluding that day) of the selected date, which is summarized by default; 
 Usage: Last_90_days(evaluates fields/expressions); 
 Example: Last_90_days(MAX(Net Sales)), which returns the maximum value of Net Sales for the past 90 days(not including that day) of the selected date;

WTD.en:
WTD 
 Description: return the calculated index value from the first day of the week to the selected date, default is summary; 
 Usage: WTD(evaluate field/expression, n); 
 Example: WTD(MAX(Net Sales),-3), returns the maximum value of Net Sales for the same time segment 3 weeks before the week to which the selected date belongs, where MAX,-3 is not required;

MTD.en:
MTD 
 Description: return the calculated index value from the first day of the month to the selected date, default is summary; 
 Usage: MTD(computed field/expression, n); 
 Example: MTD(MAX(Net Sales),-3), returns the maximum value of Net Sales for the same period of time before march of the month to which the selected date belongs, where MAX,-3 is not required;

QTD.en:
QTD 
 Description: return the calculated index value from the first day of the quarter to the selected date, default is summary; 
 Usage: QTD(evaluate field/expression, n); 
 Example: QTD(MAX(Net Sales),-3), returns the maximum value of Net Sales before the third quarter of the quarter to which the selected date belongs, where MAX,-3 is not required;

YTD.en:
YTD 
 Description: return the calculated index value from the first day of the year to the selected date, default is summary; 
 Usage: YTD(compute field/expression, n); 
 Example: YTD(MAX(Net Sales),-3), returns the maximum value of Net Sales for the same time segment 3 years ago of the year to which the selected date belongs, where MAX,-3 is not required;

LWEEK.en:
LWEEK 
 Description: returns the calculation index value of a whole week on the selected date, which is summarized by default; 
 Usage: LWEEK(evaluate field/expression, n); 
 Example: LWEEK(MAX(Net Sales),-3), which returns the maximum value of Net Sales of the time range pushed 3 weeks before the selected date, where MAX,-3 is not required;

LMONTH.en:
LMONTH 
 Description: returns the calculation index value of a whole month on the selected date, which is summarized by default; 
 Usage: LMONTH(evaluate field/expression, n); 
 Example: LMONTH(MAX(Net Sales),-3), which returns the maximum value of Net Sales for the period of 3 months before the selected date.

LQUARTER.en:
LQUARTER 
 Description: returns the calculation index value of the whole quarter on the selected date, which is summarized by default; 
 Usage: LQUARTER(calculated field/expression, n); 
 Example: LQUARTER(MAX(Net Sales),-3), which returns the maximum value of Net Sales in a time range of 3 quarters ahead of the last quarter of the selected date, where MAX,-3 is not required;

LYEAR.en:
LYEAR 
 Description: returns the calculation index value of a whole year on the selected date, which is summarized by default; 
 Usage: LYEAR(calculated field/expression, n); 
 Example: LYEAR(MAX(Net Sales),-3), which returns the maximum value of Net Sales in the time range of 3 years before the selected date.

WEEK.en:
WEEK 
 Description: returns the calculation index value of the whole week of the selected date, which is summarized by default; 
 Usage: WEEK(evaluate field/expression, n); 
 Example: WEEK(MAX(Net Sales),-3), which returns the maximum value of Net Sales for a time range of 3 weeks ahead of the selected date, where MAX,-3 is not required;

LWTD.en:
LWTD 
 Description: returns the data from the start date of last week to the selected date, which is summarized by default; 
 Usage: LWTD(evaluate field/expression, n); 
 Example: LWTD(MAX(Net Sales),-3), which returns the maximum value of Net Sales in the time range from last week's start date of the selected date to 3 weeks ahead of the selected date.

MONTH.en:
MONTH 
 Description: return the data of a whole month of the selected date, which is summarized by default; 
 Usage: MONTH(evaluate field/expression, n); 
 Example: MONTH(MAX(Net Sales),-3), which returns the maximum value of Net Sales for the whole MONTH of the selected date and then pushes forward 3 months.

LMTD.en:
LMTD 
 Description: return the data from the start date of last month to the selected date, the default is the summary; 
 Usage: LMTD(evaluate field/expression, n); 
 Example: LMTD(MAX(Net Sales),-3), which returns the maximum value of Net Sales in the time range from the start date of the last month to the selected date 3 months before the selected date, where MAX,-3 is not required;

QUARTER.en:
QUARTER 
 Description: Return the selected date when the quarterly data, the default is summary; 
 Usage: QUARTER(computed field/expression, n); 
 Example: QUARTER(MAX(Net Sales),-3), returns the maximum value of Net Sales on the selected date when the whole QUARTER is pushed 3 quarters ahead, where MAX,-3 is not required;

LQTD.en:
LQTD 
 Description: return the data from the start date of last quarter to the selected date, which is summarized by default; 
 Usage: LQTD(evaluate field/expression, n); 
 Example: LQTD(MAX(Net Sales),-3), which returns the maximum value of Net Sales in the time range from the start date of the last quarter of the selected date to the date selected 3 quarters ahead.

YEAR.en:
YEAR 
 Description: return the data of the year of the selected date, the default is summary; 
 Usage: YEAR(computed field/expression, n); 
 Example: YEAR(MAX(Net Sales),-3), which returns the maximum value of Net Sales in the time range of 3 years before the selected date.

LYTD.en:
LYTD 
 Description: calculate the data from the start date of last year to the selected date, which is summarized by default; 
 Usage: LYTD(evaluate field/expression, n); 
 Example: LYTD(MAX(Net Sales),-3). Calculate the maximum value of Net Sales in the time range of 3 years from the start date of last year to the selected date.

LTD.en:
LTD 
 Description: Return all production data less than the selected date, the default is summary; 
 Usage: LTD(evaluate field/expression); 
 Example: LTD(MAX(Net Sales)), which returns the maximum value of Net Sales less than the selected time range, where MAX is not required;

WTD_COUNTDAYS.en:
WTD_COUNTDAYS 
 Description: Return the calculated index value from the first day of the week to the selected date, It follows mutual exclusion rule with Date Dimension; 
 Usage: WTD_COUNTDAYS(); 
 Example: SUM(Net Sales)/WTD_COUNTDAYS(), Returns the week average of Net Sales from the first day of the week to the selected date;

MTD_COUNTDAYS.en:
MTD_COUNTDAYS 
 Description: Return the calculated index value from the first day of the month to the selected date, It follows mutual exclusion rule with Date Dimension; 
 Usage: MTD_COUNTDAYS(); 
 Example: SUM(Net Sales)/WTD_COUNTDAYS(), Returns the month average of Net Sales from the first day of the month to the selected date;

QTD_COUNTDAYS.en:
QTD_COUNTDAYS 
 Description: Return the calculated index value from the first day of the quarter to the selected date, It follows mutual exclusion rule with Date Dimension; 
 Usage: QTD_COUNTDAYS(); 
 Example: SUM(Net Sales)/QTD_COUNTDAYS(), Returns the quarter average of Net Sales from the first day of the quarter to the selected date;

YTD_COUNTDAYS.en:
YTD_COUNTDAYS 
 Description: Return the calculated index value from the first day of the year to the selected date, It follows mutual exclusion rule with Date Dimension; 
 Usage: YTD_COUNTDAYS(); 
 Example: SUM(Net Sales)/YTD_COUNTDAYS(), Returns the year average of Net Sales from the first day of the year to the selected date;

TRENDS_COUNTDAYS.en:
TRENDS_COUNTDAYS 
 Description: returns the number of days within the date range of trends component; 
 Usage: TRENDS_COUNTDAYS(); 
 Example: SUM(Net Sales)/TRENDS_COUNTDAYS(), returns daily average of Net Sales within the date range of trends component.

MxD.en:
MxD 
 Description: data from x days before the specified date to the specified date; 
 Usage: MxD[-x,x]; 
 Example: MxD[-8,8], which returns the data moved forward 8 days, including the current day, up -90 to 90 days;

MxW.en:
MxW 
 Description: data from x weeks before the specified date to the specified week; 
 Usage: MxW[-x,x]; 
 Example: MxW[-8,8], which returns the data moved forward 8 weeks, including the current week, up -52 to 52 weeks;

MxM.en:
MxM 
 Description: the data from X months before the specified date to the specified month; 
 Usage: MxM[-x,x]; 
 Example: MxM[-8,8], which returns data moved forward 8 months, including the current month, up -36 to 36 months;

MxQ.en:
MxQ 
 Description: data from x quarters prior to the specified date to the specified quarter; 
 Usage: MxQ[-x,x]; 
 Example: MxQ[-8,8], which returns the data moved forward by 8 quarters, including the current quarter, up -24 to 24 quarters;

MxY.en:
MxY 
 Description: data from x years prior to the specified date to the specified year; 
 Usage: MxY[-x,x]; 
 Example: MxY[-8,8], which returns data moved forward by 8 years, including the current year, up -10 to 10 years;

CELL.en:
CELL 
 Description: Use table designed cells as calculation elements; 
 Usage: CELL (cell number); 
 Example:CELL(C2),Calculate according to the content of cell C2 design in table design;

COUNTDAYS.en:
COUNTDAYS 
 Description: Returns the number of days within the selected date range; It follows mutual exclusion rule with Date Function and Date Dimension; 
 Usage: COUNTDAYS(); 
 Example:SUM(Net Sales)/COUNTDAYS(),Returns the daily average of Net Sales within the selected date range;

Next_7_days.en:
Next_7_days 
 Description: Returns the data of the next 7 days (including that day) of the selected date, which is summarized by default; 
 Usage: Next_7_days(evaluate fields/expressions); 
 Example:Next_7_days(MAX(Net Sales)), returns the maximum value of Net Sales for the next 7 days(including the day) of the selected date;

Next_30_days.en:
Next_30_days 
 Description: Returns the data of the next  30 days (including that day) of the selected date, which is summarized by default; 
 Usage: Next_30_days(evaluates fields/expressions); 
 Example:Next_30_days(MAX(Net Sales)), which returns the maximum value of Net Sales for the next  30 days(including that day) of the selected date;

Next_90_days.en:
COUNTDAYS 
 Description: Returns the data of the next  90 days (including that day) of the selected date, which is summarized by default; 
 Usage: Next_90_days(evaluates fields/expressions); 
 Example:Next_90_days(MAX(Net Sales)), which returns the maximum value of Net Sales for the next 90 days(including that day) of the selected date;

Till_Weekend.en:
Till_Weekend 
 Description: return the calculated index value from selected date to the last day of the week, default is summary; 
 Usage: Till_Weekend(evaluate field/expression, n); 
 Example:Till_Weekend(MAX(Net Sales),3), returns the maximum value of Net Sales for the same time segment 3 weeks after the week to which the selected date belongs, where MAX,3 is not required;

Till_Month_end.en:
Till_Month_end 
 Description: return the calculated index value from selected date to the last day of the month,default is summary; 
 Usage: Till_Month_end(computed field/expression, n); 
 Example:Till_Month_end(MAX(Net Sales),3), returns the maximum value of Net Sales for the same period of time after 3 months of the month to which the selected date belongs, where MAX,3 is not required;

Till_Quarter_end.en:
Till_Quarter_end 
 Description: return the calculated index value from selected date to the last day of the quarter,default is summary; 
 Usage: Till_Quarter_end(evaluate field/expression, n); 
 Example:Till_Quarter_end(MAX(Net Sales),3), returns the maximum value of Net Sales after the 3 quarters of the quarter to which the selected date belongs, where MAX,3 is not required;

Till_Year_end.en:
Till_Year_end 
 Description: return the calculated index value from selected date to the last day of the year,default is summary; 
 Usage: Till_Year_end(evaluate field/expression, n); 
 Example:Till_Year_endMAX(Net Sales),3), returns the maximum value of Net Sales after the 3 years of the year to which the selected date belongs, where MAX,3 is not required;

COUNT_DUPL_DAYS.en:
COUNT_DUPL_DAYS 
 Description: returns the number of duplicate date on the selected date; 
 Usage: COUNT_DUPL_DAYS(); 
 Example:COUNT_DUPL_DAYS(), which returns the number of duplicate date on the selected date. 
 The selected dates are Octorber and November 2022, the number of duplicate date from 1st to 30th is 2, and the number of duplicate date from 31st is 1;

COUNT_DUPL_MONTHS.en:
COUNT_DUPL_MONTHS 
 Description: returns the number of duplicate month on the selected date; 
 Usage: COUNT_DUPL_MONTHS(); 
 Example:COUNT_DUPL_MONTHS(), which returns the number of duplicate month on the selected date. 
 The selected dates are January and February 2022, the number of duplicate month from January to February is 2, and the number of duplicate month from others is 1;

COUNT_DUPL_WEEKS.en:
COUNT_DUPL_WEEKS 
 Description: returns the number of duplicate week on the selected date; 
 Usage: COUNT_DUPL_WEEKS(); 
 Example:COUNT_DUPL_WEEKS(), which returns the number of duplicate week on the selected date. 
 The selected dates are January and February 2022, the number of duplicate week from week1 to week 8 is 2, and the number of duplicate week from others is 1;

COUNT_DUPL_QUARTERS.en:
COUNT_DUPL_QUARTERS 
 Description: returns the number of duplicate quarter on the selected date; 
 Usage: COUNT_DUPL_QUARTERS(); 
 Example:COUNT_DUPL_QUARTERS(), which returns the number of duplicate quarter on the selected date. 
 The selected dates are January and June 2022, the number of duplicate quarter from Q1 to Q2 is 2, and the number of duplicate quarter from others is 1;
